import React from "react";
import "./notifications.scss";
import Notis from "./notis";
import data from "../../../jsonData/notificationdata.json";
import { GoBell } from "react-icons/go";

const Notifications = () => {
  const notisdata = data.notifications;
  return (
    <div className="info">
      {notisdata.map((nosdata) => (
        <Notis icon={notisdata.icon} message={notisdata.message} />
      ))}
    </div>
  );
};



const Newsfeed = () => {
    const newsfeeddata = data.news;
    return (
      <div className="newsfeed">
        <h1>Newsfeed</h1>
        <div classname="newsbox">
          {newsfeeddata.map((newsdata) => (
            <News
              name={newsdata.name}
              imgUrl={newsdata.imgUrl}
              message={newsdata.message}
            />
          ))}
        </div>
      </div>
    );
  };

export default Notifications;
